import React from 'react';
import Description from '../components/MainPage/Description';
import Products from "../components/MainPage/Products"
import Advantages from '../components/MainPage/Advantages';
import bck from "../img/Gradient.png";

export default function Main() {
  return (
    <div style={{backgroundImage: `url(${bck})`, backgroundRepeat: "no-repeat", backgroundSize: "contain", backgroundPosition: "bottom center"}}>
      <Description />
      <Products />
      <Advantages />
    </div>
  )
}
